            onAdd: function (map) {
                this._map = map;

            _update: function () {
                var map = this._map,
                    bounds = map.getBounds(),
                    zoom = map.getZoom();

                this.eachLayer(this.removeLayer, this);

                var interval = this.options.interval;

                var latLines = [];

                        }).addTo(this);
                    }

                    ], {
